package com.team.friend;

public class FriendB {
			
	private int num;
	private String myid;
	private String yourid;
	
	
	public FriendB() {
		// TODO Auto-generated constructor stub
	}


	public int getNum() {
		return num;
	}


	public void setNum(int num) {
		this.num = num;
	}


	public String getMyid() {
		return myid;
	}


	public void setMyid(String myid) {
		this.myid = myid;
	}


	public String getYourid() {
		return yourid;
	}


	public void setYourid(String yourid) {
		this.yourid = yourid;
	}


	public FriendB(int num, String myid, String yourid) {
		super();
		this.num = num;
		this.myid = myid;
		this.yourid = yourid;
	}
	
	
	
	
	
}
